INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (56, N'Director of Student Activities', N'Provides leadership to student activities programs, oversees campus events, and promotes student engagement.', 12)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (57, N'Student Activities Coordinator', N'Assists with planning and organizing campus events, manages student organizations, and coordinates student leadership development programs.', 12)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (58, N'Event Planner', N'Plans and coordinates various events on campus, including conferences, workshops, and social activities.', 12)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (59, N'Club and Organization Advisor', N'Provides guidance and support to student clubs and organizations, assists with event planning, and facilitates leadership development.', 12)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (60, N'Intramural Sports Coordinator', N'Organizes and manages intramural sports programs, schedules competitions, and oversees sports facilities.', 12)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (61, N'Director of Career Services', N'Provides leadership to career services programs, develops career resources, and facilitates career development initiatives.', 13)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (62, N'Career Advisor', N'Provides career counseling and guidance to students, assists with job search strategies, and conducts career assessments.', 13)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (63, N'Employer Relations Specialist', N'Builds and maintains relationships with employers, facilitates recruitment events, and connects students with job opportunities.', 13)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (64, N'Resume/Cover Letter Consultant', N'Provides assistance with resume and cover letter writing, conducts workshops, and offers feedback on job application materials.', 13)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (65, N'Internship Coordinator', N'Coordinates internship programs, assists students in securing internships, and provides support throughout the internship experience.', 13)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (66, N'Director of International Programs', N'Oversees international exchange programs, develops study abroad opportunities, and supports international students.', 14)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (67, N'Study Abroad Advisor', N'Provides guidance to students interested in studying abroad, assists with program selection, and manages application processes.', 14)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (68, N'International Student Advisor', N'Offers support and guidance to international students, assists with immigration and visa-related matters, and promotes cross-cultural understanding.', 14)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (69, N'International Programs Coordinator', N'Coordinates logistics for international programs and events, develops partnerships with international institutions, and facilitates cultural exchanges.', 14)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (70, N'Global Learning Specialist', N'Designs and delivers global learning initiatives, develops intercultural competency training, and promotes global awareness on campus.', 14)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (71, N'Marketing Manager', N'Develops marketing strategies, manages marketing campaigns, conducts market research, and oversees branding and promotional activities.', 15)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (72, N'Digital Marketing Specialist', N'Executes digital marketing campaigns, manages social media platforms, analyzes marketing analytics, and implements SEO strategies.', 15)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (73, N'Marketing Coordinator', N'Assists with marketing initiatives, coordinates marketing events, prepares marketing materials, and supports marketing campaigns.', 15)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (74, N'Marketing Analyst', N'Analyzes marketing data, tracks marketing performance metrics, conducts market research, and provides insights for marketing strategies.', 15)
INSERT [dbo].[JOBS] ([JOB_ID], [JNAME], [JDESCRIPTION], [DEPARTMENT_ID]) VALUES (75, N'Public Relations Specialist', N'Manages public relations activities, develops press releases and media kits, cultivates media relationships, and handles crisis communications.', 15)
