INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (1, N'English Literature', N'Focuses on the study of English literature, including literary analysis, critical thinking, and interpretation of various literary works.', 1)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (2, N'Fine Arts', N'Explores various forms of visual arts, including painting, sculpture, photography, and digital art, emphasizing creativity and artistic expression.', 1)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (3, N'History', N'Examines past events, civilizations, and societies, analyzing historical sources, conducting research, and interpreting historical contexts and narratives.', 1)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (4, N'Music Performance', N'Focuses on instrumental or vocal performance, music theory, and ensemble participation, developing musical skills and artistic expression.', 1)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (5, N'Biology', N'Studies living organisms, their structures, functions, and interactions, exploring areas such as cell biology, genetics, ecology, and evolution.', 2)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (6, N'Chemistry', N'Focuses on the composition, properties, and reactions of substances, including organic and inorganic chemistry, analytical chemistry, and physical chemistry.', 2)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (7, N'Physics', N'Examines the fundamental principles of matter, energy, and their interactions, covering areas such as mechanics, electromagnetism, thermodynamics, and quantum physics.', 2)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (8, N'Mathematics', N'Explores mathematical concepts, theories, and applications, including calculus, algebra, geometry, statistics, and mathematical modeling.', 2)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (9, N'Civil Engineering', N'Focuses on the design, construction, and maintenance of infrastructure such as bridges, roads, buildings, and water supply systems.', 3)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (10, N'Mechanical Engineering', N'Covers the design and development of mechanical systems and devices, including engines, machines, thermal systems, and robotics.', 3)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (11, N'Electrical Engineering', N'Focuses on the study of electrical systems, electronics, power generation, transmission, and utilization, including circuits, controls, and telecommunications.', 3)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (12, N'Computer Engineering', N'Combines computer science and electrical engineering to design and develop computer hardware and software systems, including computer architecture, embedded systems, and digital systems design.', 3)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (13, N'Software Engineering', N'Covers software development methodologies, programming languages, software testing, and software project management.', 4)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (14, N'Data Science', N'Focuses on extracting insights and knowledge from large datasets, including data analysis, machine learning, and statistical modeling.', 4)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (15, N'Cybersecurity', N'Focuses on protecting computer systems and networks from unauthorized access, data breaches, and cyber threats, including network security and cryptography.', 4)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (16, N'Artificial Intelligence', N'Explores the design and development of intelligent computer systems, including machine learning, natural language processing, and computer vision.', 4)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (17, N'Journalism', N'Covers news reporting, writing, investigative journalism, media ethics, and multimedia storytelling in various media platforms.', 5)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (18, N'Public Relations', N'Focuses on managing and maintaining relationships between organizations and their audiences through strategic communication and media relations.', 5)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (19, N'Advertising', N'Explores the principles and practices of creating persuasive messages and campaigns, including market research, creative strategy, and media planning.', 5)
INSERT [dbo].[MAJORS] ([MAJOR_ID], [MNAME], [MDESCRIPTION], [FACULTY_ID]) VALUES (20, N'Digital Media', N'Covers the production, management, and analysis of digital media content, including web design, social media, interactive media, and content marketing.', 5)
